let treck,
    play = 0;


window.onload = function() {
    treck = 0; // Присваиваем переменной ноль
};

nameSong.textContent =  playlist[0].nameSong;
infoArtist.textContent =  playlist[0].auther;
albumTitle.innerHTML =  playlist[0].imageAlbum;



function switchTreck (numTreck){
    audio.src = './audio/' + playlist[numTreck].namefile;
    audio.currentTime = 0;
    nameSong.textContent =  playlist[numTreck].nameSong;
    infoArtist.textContent =  playlist[numTreck].auther;
    albumTitle.innerHTML =  playlist[numTreck].imageAlbum;
    audio.play();
    play = 1;
    btnPlay.src = `/img/StatePause.svg`;
}

btnPlay.parentElement.addEventListener("click", function() {
  
    if(play == 0){
        audio.play(); 
        
        setInterval(function() {
            let audioTime = Math.round(audio.currentTime);
            time.textContent =  ((audioTime/60 < 0) ? "00" : "0"+Math.floor(audioTime/60))+((audioTime%60 < 10) ? ":0" : ":")+audioTime%60;
            let audioLength = Math.round(audio.duration);
            timeLine.style.width = (audioTime * 100) / audioLength + '%';
            if (audioTime == audioLength-1 ) {
                treck++; 
                switchTreck(treck);
            }
        }, 10);
        play = 1;
        
        btnPlay.src = `/img/StatePause.svg`;
        console.log("play");
    }else{
        audio.pause();
        btnPlay.src = `/img/StatPlay.svg`;
        play = 0;
        console.log("pause");
    }
 
});

btnNext.addEventListener("click", function() {
    treck++;
    switchTreck(treck);
});

btnPrev.addEventListener("click", function() {
    treck--;
    switchTreck(treck);
});
  
repeatAlbum.addEventListener("click", function() {
    (event.target.checked)? repeatAlbum.previousElementSibling.firstElementChild.style.stroke ="#008162":
    repeatAlbum.previousElementSibling.firstElementChild.style.stroke ="#000000";
    
});

addSpotify.addEventListener("click", function(event) {
    console.log(event.target.checked);
    (event.target.checked)? addSpotify.previousElementSibling.firstElementChild.style.fill ="#54BA5F":
    addSpotify.previousElementSibling.firstElementChild.style.fill ="#AEAEAE";
    
});
